body {
  color: beige;
  /* background: #111; */
  margin-bottom: 200px;
}

h1 {
  text-align: center;
  color: lightgreen;
}

div.gallery {
  margin: 5px;
  border: 1px solid #ccc;
  float: left;
  width: 180px;
}

div.gallery:hover {
  border: 1px solid #777;
}

div.gallery img {
  width: 100%;
  height: auto;
}

div.desc {
  padding: 15px;
  text-align: center;
}

.box h1::after {
  content: "";
  width: 5px;
  height: 48px;
  background: #ec7fff;
  display: inline-block;
}

.box h1 {
  display: flex;
  justify-content: center;
  align-items: center;
  gap: 2px;
}

@keyframes cursor-blink {
  0% {
    opacity: 0;
  }
}

.box h1::after {
  animation: cursor-blink 1.5s steps(2) infinite;
}

h2 {
  border-bottom: dashed #ddd 1px;
  margin: 1em auto;
  max-width: 500px;
  font-size: 24pt;
  font-variant: small-caps;
  color: gold;
  text-align: center;
}

ol {
  font-size: large;
  line-height: 1.6em;
  max-width: 600px;
  margin: auto;
}

header h1 {
  font-size: 40px;
}

header {
  max-width: 900px;
  margin: auto;
}

h3 {
  color: gold;
}

main {
  max-width: 850px;
  margin: auto;
}

